import './App.css';

function Nav() {
  return (
    <div className="Nav">
        <header className="nav_7exu6c6qr semplice-navbar active-navbar sticky-nav  menu-type-text" data-cover-transparent="disabled" data-bg-overlay-visibility="visible"data-mobile-fallback="enabled">
							<div className="container" data-nav="logo-left-menu-right">
								<div className="navbar-inner menu-type-text" data-xl-width="12" data-navbar-type="container">
									<div className="logo navbar-left" data-font="font_30l19lqoa"><a href="https://www.daraoke.co" title="Dara Oke">Dara Oke</a></div>
									<nav className="standard navbar-right" data-font="font_30l19lqoa"><ul className="menu"><li class="menu-item menu-item-type-post_type menu-item-object-page menu-item-102"><a href="https://www.daraoke.co/about"><span>About</span></a></li>
<li class="menu-item menu-item-type-custom menu-item-object-custom menu-item-103"><a href="mailto:daratloke@gmail.com"><span>Contact</span></a></li>
</ul></nav>
									<div className="hamburger navbar-right semplice-menu"><a class="open-menu menu-icon"><span></span></a></div>
								</div>
							</div>
						</header>
    </div>
  );
}

export default Nav;
